description:
Away We Go (2009)  

Verenigde Staten / Verenigd Koninkrijk
Drama / Roadmovie
98 minuten

geregisseerd door Sam Mendes
met John Krasinski, Maya Rudolph en Maggie Gyllenhaal

Het gelukkige stel Burt en Verona (Krasinski en Rudolph), verwacht hun eerste kind. Ze zoeken echter de perfecte plaats om een leven op te bouwen om daar hun gezin te stichten. Ze besluiten door heel Amerika te reizen, om deze perfecte plek te vinden.


